social_posts.post_text:
More and more I’m approaching life from a “yes, and” attitude. Yes, absolutely, the government needs to do way more to address the climate crisis (and the current trend in NYC is disheartening). Corporations need to do way more. And individuals, especially those in wealthy countries, also need to do more.
•
@the.commons.earth addresses one piece of the puzzle. It’s an app where you can measure your individual carbon footprint, learn ways to reduce it through making lifestyle changes, and purchase vetted offsets. All of our little actions do add up, for better or worse. #ad

